@Satyam

You're welcome. I basically already had the test case in production code, and had been bitten by the bug missing a call, so all I had to do was chop things out until I could see the call hierarchy change between OK and broken.

There are two reasons that you are not seeing the problem with the performance tests. 
1. Many tests are not running into the path. testSearchBinaryMethod is one test which runs into this path and this is failing because of the NPE. 
2. Actually, even with the first test, there is not much regression that I see. That is because the model is cached and the cached elements are being used here in this testcase. In this patch, model elements are getting created for all the classes in the package that has the match. This operation is costly. To get the sense of the effect, I modified the test case by closing the project and reopening it and the numbers are bad - 220ms without the patch and 1.2s with the patch.
Here is how I modified the measuring loop.
###
for (int i=0; i<MEASURES_COUNT; i++) {
   // clean before test
   cleanCategoryTableCache(false, scope, resultCollector);
   runGc();
   JDT_CORE_PROJECT.getProject().close(null);
   AbstractJavaModelTests.waitUntilIndexesReady();
   JDT_CORE_PROJECT.getProject().open(null);
   AbstractJavaModelTests.waitUntilIndexesReady();
   // test
   startMeasuring();
   search(name, METHOD, ALL_OCCURRENCES, scope, resultCollector);
   stopMeasuring();
}
###
